import React from 'react';
import QuizTitle from './QuizTitle';



const style = {display:'flex' , flexDirection:'column' , justifyContent:'center', margin:'auto', backgroundColor: 'blue', width: '700px' , height:'400px' };

const BQuizTitleox2 = () => {
  return (
		<div className="quiztitle" style={style}>
    	How Do You Like Front End?
		</div>

  );
};

export default QuizTitle;
